import React from 'react';
import styled from 'styled-components';

const HeroSection = styled.section`
	background: linear-gradient(135deg, #a855f7 0%, #ec4899 100%);
	padding: 3rem 1rem;
	text-align: center;
	color: white;
	min-height: 20vh;
	display: flex;
	align-items: center;
`;

const HeroContent = styled.div`
	max-width: 900px;
	margin: 0 auto;
`;

const HeroTitle = styled.h1`
	font-size: 3.5rem;
	font-weight: 700;
	margin-bottom: 1rem;
	line-height: 1.1;

	@media (max-width: 768px) {
		font-size: 2.25rem;
	}
`;

const HeroSubtitle = styled.p`
	font-size: 1.25rem;
	margin-bottom: 2rem;
	opacity: 0.95;
`;

const HeroButtons = styled.div`
	display: flex;
	gap: 1rem;
	justify-content: center;
	flex-wrap: wrap;
`;

const Button = styled.button`
	padding: 0.75rem 1.5rem;
	border-radius: 0.5rem;
	border: none;
	font-weight: 600;
	cursor: pointer;
	transition: all 0.3s ease;
	background-color: ${props => (props.primary ? '#ffffff' : 'rgba(255, 255, 255, 0.2)')};
	color: ${props => (props.primary ? '#a855f7' : '#ffffff')};
	display: flex;
	align-items: center;
	gap: 0.5rem;

	&:hover {
		transform: translateY(-2px);
		box-shadow: 0 10px 20px rgba(0, 0, 0, 0.2);
	}
`;

const FeaturesSection = styled.section`
	padding: 4rem 1rem;
	background-color: ${props => (props.darkMode ? '#1f2937' : '#f9fafb')};
`;

const FeaturesContainer = styled.div`
	max-width: 1200px;
	margin: 0 auto;
`;

const FeaturesTitle = styled.h2`
	font-size: 2.25rem;
	font-weight: 700;
	text-align: center;
	margin-bottom: 3rem;
	color: ${props => (props.darkMode ? '#ffffff' : '#111827')};
`;

const FeaturesGrid = styled.div`
	display: grid;
	grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
	gap: 2rem;
`;

const FeatureCard = styled.div`
	background-color: ${props => (props.darkMode ? '#111827' : '#ffffff')};
	border-radius: 1rem;
	padding: 2rem;
	box-shadow: 0 10px 25px rgba(0, 0, 0, 0.1);
	text-align: center;
`;

const FeatureIcon = styled.div`
	font-size: 3rem;
	margin-bottom: 1rem;
`;

const FeatureTitle = styled.h3`
	font-size: 1.25rem;
	font-weight: 700;
	margin-bottom: 0.5rem;
	color: ${props => (props.darkMode ? '#ffffff' : '#111827')};
`;

const FeatureDescription = styled.p`
	color: ${props => (props.darkMode ? '#d1d5db' : '#4b5563')};
	line-height: 1.6;
`;

const HomePage = ({ darkMode, onNavigate }) => {
	return (
		<>
			<HeroSection>
				<HeroContent>
					<HeroTitle>砖 转  住  专</HeroTitle>
					<HeroSubtitle>
						专  拽 砖 , 转 住.  转爪 转 住驻专 住 砖 砖 砖 专转,  转 住 拽 
						住驻专 转 砖 砖 砖专 转  壮 . 专 砖  专  砖壮 转 转, 转 砖 转拽, 
						专.
					</HeroSubtitle>
					<HeroButtons>
						<Button primary onClick={() => onNavigate('my-miracles')}>
							住 砖
						</Button>
						<Button onClick={() => onNavigate('margalits-miracles')}>住 砖 专转</Button>
					</HeroButtons>
				</HeroContent>
			</HeroSection>

			<FeaturesSection darkMode={darkMode}>
				<FeaturesContainer>
					<FeaturesTitle darkMode={darkMode}> 转 转 爪 ?</FeaturesTitle>
					<FeaturesGrid>
						<FeatureCard darkMode={darkMode}>
							<FeatureIcon></FeatureIcon>
							<FeatureTitle darkMode={darkMode}>住驻专 住</FeatureTitle>
							<FeatureDescription darkMode={darkMode}>
								拽专 转 住驻专 住 驻 砖拽专  砖 专转
							</FeatureDescription>
						</FeatureCard>
						<FeatureCard darkMode={darkMode}>
							<FeatureIcon></FeatureIcon>
							<FeatureTitle darkMode={darkMode}>拽</FeatureTitle>
							<FeatureDescription darkMode={darkMode}>砖转驻 转 住 砖 注 拽 砖 拽  转 </FeatureDescription>
						</FeatureCard>
						<FeatureCard darkMode={darkMode}>
							<FeatureIcon></FeatureIcon>
							<FeatureTitle darkMode={darkMode}>专爪转</FeatureTitle>
							<FeatureDescription darkMode={darkMode}> 专爪 爪 注 住驻专 住 砖</FeatureDescription>
						</FeatureCard>
					</FeaturesGrid>
				</FeaturesContainer>
			</FeaturesSection>
		</>
	);
};

export default HomePage;
